        const userRole = AuthenticationService.getLoggedUerRole();

        return (
            <div className="px-3">
                <div class="jumbotron">
                <h1>Inventory UI</h1>
                </div>
                <div className="row">
 
                {/*<Link
                        to={`/deliveries?Filter.number=${this.state.pdUpdateShow.pd.deliveryNumber}&deliveryView=DeliveryDetailView`}>delivery</Link>*/}

                {(userRole === 'ROLE_Admin' || userRole === 'ROLE_Mol') &&
                <div class="col-md-3">
                    <h2>Users</h2>
                    <p>Manage users .</p>                   
                    <p><Link to='/users' className="btn btn-default">Users &raquo;</Link></p>
                            <p><Link to='/users/-1' className="btn btn-default">Add New User &raquo;</Link></p>                               
                 </div >
                    }
                </div>
                        </div>  
                    
                       
       
    
   
         )
    }

}

export default HomeComponent
